import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Num1 from "./1";
import SchoolArchive from "./SchoolArchive";


class Layout extends React.Component {
    navigate() {
        console.log(this.props.history);
        this.props.history.push("/");
    }
    render() {
        return (
            <Router>
                <nav className="navigation">
                    <ul className="page-navi">
                        <li className="page-navi__item">
                        <Link to="/" className="page-navi__link">
                                <span className="arrow-prev">
                                    <span className="prev">Prev</span>
                                </span>
                            </Link>
                        </li>
                        <li className="page-navi__item">
                            <Link to="/2" className="page-navi__link">
                                <span className="arrow-next">
                                    <span className="next">Next</span>
                                </span>
                            </Link>
                        </li>
                    </ul>
                </nav>
                <div className="dialy">
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/about">About</Link>
                        </li>
                        <li>
                            <Link to="/archive">WebGL School Archive</Link>
                        </li>
                        <li>
                            <Link to="/1">1</Link>
                        </li>
                    </ul>

                    <hr />

                    {/*A <Switch> looks through all its children <Route>lements and renders the first one whose pathmatches the current URL. Use a <Switch> any time you have multiple routes, but you want only one of them to render at a time */}
                    <div className="daily">
                        <Switch>
                            <Route exact path="/">
                                <Home />
                            </Route>
                            <Route path="/about">
                                <About />
                            </Route>
                            <Route path="/archive">
                                <SchoolArchive />
                            </Route>
                            <Route path="/1">
                                <Num1 num="1" />
                            </Route>
                        </Switch>
                    </div>
                </div>
            </Router>
        );
    }
}
function Home() {
    return (
        <div>
            <h2>Home</h2>
        </div>
    );
}

function About() {
    return (
        <div>
            <h2>About</h2>
        </div>
    );
}


export default Layout;
